import React from "react";
import { Route, Routes, Link, useLocation } from "react-router-dom";
import { useRef, useCallback } from "react";
import { useState, useEffect } from "react";
import Weather from "../../components/phone/Weather";
import Camera from "../../components/phone/Camera";
import Game from "../../components/phone/Game";
import Contacts from "../../components/phone/Contacts";
import SomeApp from "../../components/phone/Shopping";
import EmailPhone from "../../components/phone/EmailPhone";
import "./css/Phone.css";
import fiveBars from "./assets/5_bars.png";


function PhoneClock() {
  const [currentTime, setCurrentTime] = useState(new Date());

  useEffect(() => {
    const timer = setInterval(() => {
      setCurrentTime(new Date());
    }, 1000);

    return () => {
      clearInterval(timer);
    };
  }, []);

  const timeString = currentTime.toLocaleTimeString([], {
    hour: "numeric",
    minute: "2-digit",
  });

  return (
    <div className="phone-clock">
      <p>{timeString}</p>
    </div>
  );
}

const Phone = () => {
  return (
    <div className="phone-container">
      <div className="phone-bezel">
        <div className="phone-screen">
          <div className="phone-header">
            <div className="phone-header-left">
              <p>DT&T</p>
            </div>
            <div className="phone-header-right">
              <PhoneClock />
            </div>
          </div>
          <div className="phone-app-container">
            <div className="desktop-internet">
              <Link to="weather">
                <img src="" alt="internet" className="internet-logo-desktop" />
                <br />
                Weather
              </Link>
            </div>
            <div className="desktop-contract">
              <Link to="camera">
                <img src="" alt="folder" className="folder-logo-desktop" />
                Camera
              </Link>
            </div>
            <div className="desktop-chat">
              <Link to="game">
                <img src="" alt="dan" className="dan-logo-desktop" />
                <br />
                Game
              </Link>
            </div>
            <div className="desktop-resume">
              <Link to="emailphone">
                <img src="" alt="dan" className="docu-logo-desktop" />
                <br />
                Email
              </Link>
            </div>
            {/* </>
            )} */}
            <Routes>
              <Route
                path="weather/*"
                element={
                  <div className="overlay-component">
                    <Weather />
                  </div>
                }
              />
              {/* <Route path="home" element={<Home />} /> */}
              <Route
                path="camera/*"
                element={
                  <div className="overlay-component">
                    <Camera />
                  </div>
                }
              />
              <Route
                path="game/*"
                element={
                  <div className="overlay-component">
                    <Game />
                  </div>
                }
              />
              <Route
                path="contacts/*"
                element={
                  <div className="overlay-component">
                    <Contacts />
                  </div>
                }
              />
              <Route
                path="someapp/*"
                element={
                  <div className="overlay-component">
                    <SomeApp />
                  </div>
                }
              />
              <Route
                path="emailphone/*"
                element={
                  <div className="overlay-component">
                    <EmailPhone />
                  </div>
                }
              />
            </Routes>
          </div>
          <div className="phone-footer">
            <Link to="">X</Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Phone;
